	module.exports = {"id":1224,"title":"Advisor4Schools platform","author":"eugenY","date":"01/09/2015","layout":"post","path":"/a4s/","body":"<section class=\"\" id=\"about\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-3 col-md-3\">\n        <figure class=\"floatRight\">\n          <img style=\"height: 310px;\" src=\"./adv4sch-thumb.png\" alt=\"advisor\">\n        </figure>\n      </div>\n      <div class=\"col-lg-9 col-md-6\">\n        <p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> A parametrized, opinionated search engine for the whole Swiss educational system. </p>\n        <p><i class=\"fa fa-briefcase\"></i> My responsibilities included SEO, Digital Marketing and minor frontend refactoring, mainly with jQuery and Bootstrap. Ensured a top search display with the Tag Manager, helped in putting to work subscription plans and local ads for digital marketing campaigns - mostly 'organic' and local, but also with AdSense)</p>\n        <p>Code refactoring helped with routing and handling requests in PHP and Javascript, aiming for readable and re-usable code in possible scale up scenarios.</p>\n        <button class=\"btn\"><a href=\"https://advisor4schools.com\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i></a></button>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-certificate text-danger\"></i>\n          <h5>Friendly & Supporting Founders</h5>\n          <p class=\"text-muted\">Good project managing, always appreciating and valuing tech specs</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center text-danger\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-sitemap\"></i>\n          <h5>Great Coding </h5>\n          <p class=\"text-muted\">Neatly organized project with clear, readable components</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center text-danger\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-globe\"></i>\n          <h5>Good Exposure </h5>\n          <p class=\"text-muted\">Participating in local educational and tech events</p>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n<section class=\"bg-danger text-xs-center\" id=\"concept\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Details </h2>\n        <hr class=\"light\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <img src=\"adv4sch.png\" />\n      </div>\n    </div>\n  </div>\n</section>\n"}

