	module.exports = {"id":1284,"title":"Web App - Boardaboat","author":"eugenY","layout":"post","date":"01/04/2016","path":"/boardaboat/","body":"<section class=\"\" id=\"about\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <figure class=\"floatRight col-lg-3 col-md-3\">\n        <img style=\"height: 310px;\" src=\"./b.a.b-exp.png\" alt=\"boardaboat\">\n      </figure>\n      <div class=\"col-lg-9\">\n        <p class=\"text-muted\"> A web application platform where users can rent different boats for sea trips and experiences throughout Europe</p>\n        <p><i class=\"fa fa-bullseye\"></i> Built with the Django platform, slightly inspired by 'Airbnb'.</p>\n         <p><i class=\"fa fa-briefcase\"></i> My tasks included mostly code refactoring for the client-side, debugging search and filtering processes, and do some A/B testing. The page I put most of my work on was the 'Experiences' one: this would list all relevant search results, accordingly to types and preferences, using a PostgreSQL database. Refactoring and debugging was vital at the time, since one among the essential parts of the website was displaying faulty results to the user.\n         <br /> Before my departure, the startup had a couple of 'up-ticks' with more than 50% new orders and a new investors' funding round</p>\n         <button class=\"btn\"><a href=\"https://boardaboat.com\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i><a/></button>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n      </p>\n    </div>\n    </p>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-building-o text-danger\"></i>\n          <h5>Startup Environment </h5>\n          <p class=\"text-muted\">Self-initiative, task independence and constant urge to go forward</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-bolt text-danger\"></i>\n          </p>\n          <h5>Good Coding </h5>\n          <p class=\"text-muted\">Refactoring was needed but most of the code was readable and organized\n          </p>\n          </p>\n        </div>\n        </p>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-users text-danger\"></i>\n          </p>\n          <h5>Team Developed </h5>\n          <p class=\"text-muted\">Agile Methodology centered around an international group of engineers\n          </p>\n          </p>\n        </div>\n        </p>\n      </div>\n      </p>\n    </div>\n    </p>\n  </div>\n</section>\n<section class=\"bg-danger text-xs-center\" id=\"concept\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Details </h2>\n        <hr class=\"light\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <img src=\"one.png\" />\n      </div>\n      </p>\n    </div>\n    </p>\n  </div>\n</section>\n"}

