	module.exports = {"title":"mHealth Project","author":"eugenYzeiri","layout":"post","path":"/eva/","date":"05/10/2016","body":"<section id=\"about\">\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-lg-3 col-md-3\">\n\t\t\t\t<figure class=\"floatRight\">\n\t\t\t\t\t<img src=\"./eva3.png\" />\n\t\t\t\t</figure>\n\t\t\t</div>\n\t\t\t<div class=\"col-lg-9 col-md-6\">\n\t\t\t\t<p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> Help analyze and respond to patients quicker and easier with a pre-built mHealth mobile app, by syncing and improving a backend platform to it</p>\n        <p><i class=\"fa fa-briefcase\"></i> In cooperation with the Faculty of Medicine (UNIGE) and W.H.O. Having an existing application (the Eva system from MobileODT), we experimentally built a back end version using a NoSQL architecture and node.js, with the aim of improving speed and usability. Also improved complexity and indexing in the existing MySQL database, already in use. The built platform belongs to the University as I'm not sure of its usage nowadays</p>\n        <p><i class=\"fa fa-info\"></i> Organized a conference in Geneva for Public Health issues and overcoming ODT diseases with the help of mHealth technologies. There was a workshop for the platform and a presentation of mHealth capacities to help in Global Health issues. The conference was made in the name of a new branch of W.H.O, called e-NewDeal (later Global Health Objectives) - which I helped build and consolidate an online presence, with a landing-page website, logos and SEO. Unfortunately, funding was stopped after 6 months.</p>\n        <button class=\"btn\"><b><a href=\"http://www.mobileodt.com/\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i></a></b></button>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-university text-danger\"></i>\n          <h5>Academic Environment</h5>\n          <p class=\"text-muted\">The collaborators (4) were mainly academic, researchers and/or interns, from Medicine, IT and Public Health domains.</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-bullseye text-danger\"></i>\n          <h5>Aiming at Efficiency </h5>\n          <p class=\"text-muted\">Seeing that there was an existing architecture in place, our aim as developers was to increase its efficiency and accuracy above all</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-globe text-danger\"></i>\n          <h5>Great Exposure </h5>\n          <p class=\"text-muted\">Opportunity to 'network' with participants from various organizations, like WHO, Afya HMA, UNAids, Commonwealth, etc</p>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n<section class=\"bg-faded text-xs-center\">\n\t<div class=\"container\">\n    \t<div class=\"row\">\n      \t\t<div class=\"col-lg-12 text-center\">\n        \t<h2 class=\"section-heading\">Details </h2>\n        \t<hr class=\"dark\" />\n      \t</div>\n    </div>\n  </div>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-md-3\">\n\t\t\t\t<img src=\"eva1.jpg\" />\n\t\t\t</div>\n\t\t\t<div class=\"col-md-3\">\n\t\t\t\t<img src=\"eva2.jpg\" />\n\t\t\t</div>\n      <div class=\"col-md-3\">\n        <img src=\"cerv.png\" />\n      </div>\n      <div class=\"col-md-3\">\n        <img src=\"logo.png\">\n      </div>\n\t\t</div>\n\t</div>\t\n</section>"}

