	module.exports = {"id":1224,"title":"Oda Hotel","author":"eugenYzeiri","layout":"post","date":"09/15/2016","path":"/oda/","body":"<section class=\"\" id=\"about\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12\">\n        <img src=\"Adresa.jpg\" style=\"padding-left: 20%;\"/>\n      </div>\n      <div class=\"col-lg-12\">\n        <p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> Oda is a 'Bed&amp;Breakfast' hotel in Tirana, Albania, inspired by local tradition</p>\n      <p><i class=\"fa fa-briefcase\"></i> Established an online presence by building the standalone website, crucial for the business. I developed a simple but stylish static webpage, as required by the client, migrated in a cPanel CMS. </p>\n      <p>Features included SEO & Tag Manager, responsive design for all screens, integrated booking & third-party payment methods and a showcase for the interior commodities of the hotel.  \n      <br/> The renewed online presence helped bring in an increase of some 180% in bookings from online sources. Used simple, popular libraries like jQuery, SASS or WaypointsJS.</p>\n      <button class=\"btn\"><a href=\"https://odahotel.al\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i></a></button>\n    </div>\n  </div>\n</section>\n<section class=\"text-xs-center\" id=\"concept\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Details </h2>\n        <hr class=\"light\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div classs=\"col-md-12\">\n        <img src=\"oda.png\"/> \n      </div>\n      <div class=\"col-md-12\">\n        <img src=\"oda2-thumb.png\"\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-list-ol wow bounceIn text-danger\" style=\"visibility: visible; animation: bounceIn; -webkit-animation: bounceIn;\"></i>\n          <h5>Clear Objectives & Goals</h5>\n          <p class=\"text-muted\">The tasks and the objectives were clear from the start</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-user-md wow bounceIn text-danger\" data-wow-delay=\".1s\" style=\"visibility: visible; animation: bounceIn 0.1s; -webkit-animation: bounceIn 0.1s;\"></i>\n          <h5>Autonomy </h5>\n          <p class=\"text-muted\">Full autonomy and responsibility in building the prototype </p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-certificate wow bounceIn text-danger\" data-wow-delay=\".1s\" style=\"visibility: visible; animation: bounceIn 0.1s; -webkit-animation: bounceIn 0.1s;\"></i>\n          <h5>Supporting Founders </h5>\n          <p class=\"text-muted\">Great support & feedback attitude </p>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n"}

