	module.exports = {"title":"Skenderbeg Hedge Fund Tryout","author":"Eugen Yzeiri","date":"08/01/2016","layout":"post","path":"/fund/","body":"<section class=\"\" id=\"about\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12\">\n        <p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> A Swiss Hedge Fund, among the most successful in the recent years (claimed). The idea was to build a renewed website, properly and modernly displaying the company's details, regulations, DDQs, etc.</p>\n        <p><i class=\"fa fa-briefcase\"></i> The renewed website needed to be faster, more user-friendly and have a complete redesign. For this, I used common, popular libraries and frameworks, like Angular,Bootstrap, or Mozilla's pdf js plugin.\n        <br/>The single-page app was simple but modern looking, and above all, it killed the unbearable load times that the old static, Apache-based website would take. However, the proposition was finally refused [and the site remained in the unpleasant Apache default display]</p>\n        <button class=\"btn\"><a href=\"https://skenderbeg.ch\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i></a></button>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-6 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-database text-danger\"></i>\n          <h5>Importance on References and .pdf Documents</h5>\n          <p class=\"text-muted\"></p>\n        </div>\n      </div>\n      <div class=\"col-lg-6 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-th-list text-danger\"></i>\n          <h5>Inspired by Simplicity & Organization</h5>\n          <p class=\"text-muted\"></p>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n<section class=\"text-xs-center\" id=\"concept\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Details </h2>\n        <hr class=\"light\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <img src=\"skenderbeg.png\" />\n      </div>\n    </div>\n  </div>\n</section>\n"}

