	module.exports = {"title":"Stockprimate App [Prototype]","author":"eugenYzeiri","path":"/sp/","layout":"post","date":"03/01/2016","body":"<section id=\"about\">\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-lg-12\">\n\t            <p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> A mobile app offering a common learn and play ground for stock 'newbies', with a virtual stock market (based on Live quotes) and other academic/learning tools, like 'Financial and Investing strategies', 'Uni groups', latency and price approximations.</p>\n\t            <p><i class=\"fa fa-briefcase\"></i> Co-founded by me and an Economy & Business student. For the prototype I used Hybrid Mobile Development with React Native, after a tryout with Ionic 1. The project is still in 'dev' mode, awaiting for a scalable backend and a re-design.</p>\n\t            <p><i class=\"fa fa-chevron-down\"></i> Below is included also a simple website to showcase the project, presenting the features and services to be offered</p>\n\t            <button class=\"btn\"><a href=\"https://github.com/geni94/StockPrimateBeta\">Ionic Based Demo on <i class=\"fa fa-github\"></i></a></button>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n</section>\n<section id=\"features\">\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-md-12 text-center\">\n\t\t\t\t<h2 class=\"section-heading\">Features</h2>\n\t\t\t\t<hr class=\"strong\"/>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\" col-lg-6 col-md-6 text-center\">\n\t\t\t\t<div class=\"service-box\">\n\t\t\t\t\t<i class=\"fa fa-2x fa-user-md text-danger\"></i>\n\t\t\t\t\t<h5>Full Independency and Decision Making</h5>\n\t\t\t\t\t<p class=\"text-muted\">Being our founded project, the main decisions and 'skeleton' of the project were up to us</p>\n\t\t\t\t</div>\n\t\t\t</div>\n\t\t\t<div class=\"col-lg-6 col-md-6 text-center\">\n\t\t\t\t<div class=\"service-box\">\n\t\t\t\t\t<i class=\"fa fa-2x fa-code text-danger\"></i>\n\t\t\t\t\t<h5>Software Engineering Experience</h5>\n\t\t\t\t\t<p class=\"text-muted\">Started as a school assignment, I tried building the app using hybrid [web] protocols, making it a new and worthy challenge. Learned, used and contributed to new innovative frameworks and libraries.</p>\n\t\t\t\t</div>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n</section>\n<section class=\"text-xs-center\" id=\"concept\">\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-lg-12 text-center\">\n\t\t\t\t<h2 class=\"section-heading\">Details</h2>\n\t\t\t\t<hr class=\"strong\"/>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t\t<div class=\"col-md-12\">\n\t\t\t\t<img style=\"width:80%; padding-left:20%;\" src=\"sp.gif\"/>\n\t\t\t</div>\n\t\t\t<div class=\"col-md-12\">\n\t\t\t\t<img src=\"sp.png\"/>\n \t\t\t</div>\n\t\t</div>\n\t</div>\n</section>\n"}

