	module.exports = {"id":1224,"title":"Steifit Confectionaries","author":"eugenYzeiri","date":"12/20/2015","layout":"post","path":"/sf/","body":"<section class=\"\" id=\"about\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-3 col-md-3\">\n        <figure class=\"floatRight\">\n          <img src=\"./logo.jpg\" alt=\"advisor\">\n        </figure>\n      </div>\n      <div class=\"col-lg-9 col-md-6\">\n        <p class=\"text-muted\"><i class=\"fa fa-bullseye\"></i> A nutritional startup, founded by two of my partners, offering delicious bakery gluten-free confectionaries</p>\n        <p><i class=\"fa fa-briefcase\"></i> Mainly in charge of technical and online duties, I set up a communication system for the team and took care of the online representation, by building a detailed website and a social media presence.\n        <br>The website is a simple static one, showcasing details of the products and has simple SEO.\n        <p>At the moment, the project is lacking funding to start the production line, even though we've had some great feedback for the food prototypes. A relaunch, however, would be necessary</p>\n        <button class=\"btn\"><a href=\"https://steifit.com\" target=\"_blank\">Visit Site <i class=\"fa fa-external-link\"></i></a></button>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Features </h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-user-md text-danger\"></i>\n          <h5>Full Autonomy</h5>\n          <p class=\"text-muted\">Main decisions on technical specs were left to me, except for small design decisions</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-building-o text-danger\"></i>\n          <h5>Startup Environment</h5>\n          <p class=\"text-muted\">Valuable experience in starting up a business and its challenges</p>\n        </div>\n      </div>\n      <div class=\"col-lg-4 col-md-6 text-center\">\n        <div class=\"service-box\">\n          <i class=\"fa fa-2x fa-th-list text-danger\"></i>\n          <h5>Simplicity & Organization</h5>\n          <p class=\"text-muted\">Neatly organized code and libraries for a simple project</p>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n<section class=\"text-xs-center\" id=\"concept\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 text-center\">\n        <h2 class=\"section-heading\">Details </h2>\n        <hr class=\"light\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <img src=\"sf.png\" />\n      </div>\n    </div>\n  </div>\n</section>\n"}

