	module.exports = {"title":"About","author":"eugenyzeiri","layout":"page","path":"/profile/","body":"<section class=\"text-xs-center\">\n  <div class=\"container\">\n    <img src=\"me.jpg\" alt=\"Eugen Yzeiri\" class=\"rounded-circle mx-auto d-block\" width=\"120px\">\n    <h1>< Me ></h1>\n    <p class=\"lead text-muted\">&bull; 22 years old<br/>&bull;web and software development<br/>&bull; based in Geneva</p>\n    <div class=\"service-box text-danger\">\n        <a href=\"https://github.com/geni94\"><i class=\"fa fa-github fa-2x wow bounceIn\" data-wow-duration=\"2.0s\"></i></a>\n        <a href=\"https://ch.linkedin.com/in/eugen-yzeiri-8aa10288\"><i class=\"fa fa-linkedin fa-2x wow bounceIn\" data-wow-duration=\"2.0s\"></i></a>\n        <a href=\"https://www.facebook.com/juxhinjo\"><i class=\"fa fa fa-facebook fa-2x wow bounceIn\" data-wow-duration=\"2.0s\"></i></a>\n          <a href=\"mailto:eugen.yzeiri@gmail.com\"><i class=\"fa fa-envelope fa-2x wow bounceIn\" data-wow-duration=\"2.0s\"></i></a>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-lg-6 col-md-6\">\n        <p>I enjoy mixing creativity and simplicity. My work tends to look detail-oriented and have a problem-solving attitude.\n        <br>Having lived in both developed and developing countries in the continent, I believe I understand well the European market and what the user likes (and what they would like)</p>\n      </div>\n      <div class=\"col-lg-6 col-md-6\">\n        <p>Studied Computer Science at 'Université de Genève'. </p>\n        <p>Full-stack Javascript development and improvements of User Experience are some of my favorite tasks. Able to think in higher levels of code and assist in software engineering.\n        <br>Accostumed to Scrum and agile work methodologies.</p>\n      </div>\n      <div class=\"col-lg-12 col-md-6\">\n        <p>Fluent in English and French (and some Italian).\n        <br>Contact me for an updated or more detailed resume.</p>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\" class=\"bg-danger text-xs-center\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12 \">\n        <h2 class=\"section-heading\">< Favorites ></h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-3 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Linux systems &amp; bash\">\n          <i class=\"fa-4x devicons devicons-terminal\"><p>Linux</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"React\">\n          <i class=\"fa-4x devicons devicons-react\"><p>React</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6 \">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Python\">\n          <i class=\"fa-4x devicons devicons-python\"><p>Python</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"HTML5\">\n          <i class=\"fa-4x devicons devicons-html5\"><p>HTML5&CSS</p></i>\n        </div>\n      </div>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-lg-3 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Node.js\">\n          <i class=\"fa-4x devicons devicons-nodejs\"><p>Node</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"MySQL &amp; SQLite\">\n          <i class=\"fa-4x devicons devicons-mysql\"><p>MySQL</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6 \">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Django\">\n          <i class=\"fa-4x devicons devicons-django\"><p>Django</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-3 col-xs-6 \">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Java + Android\">\n          <i class=\"fa-4x devicons devicons-android\"><p>Android dev</p></i>\n        </div>\n      </div>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-lg-6 col-xs-6\">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Sass\">\n          <i class=\"fa-4x devicons devicons-sass\"><p>Sass</p></i>\n        </div>\n      </div>\n      <div class=\"col-lg-6 col-xs-6 \">\n        <div class=\"service-box\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"AngularJS\">\n          <i class=\"fa-4x devicons devicons-angular\"><p>Angular 2</p></i>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n<section id=\"features\" class=\"bg-faded text-xs-center\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <div class=\"col-lg-12\">\n        <h2 class=\"section-heading\">< Skill Radar ></h2>\n        <hr class=\"primary\" />\n      </div>\n    </div>\n  </div>\n  <div class=\"container\">\n    <img class=\"radar-img  \" src=\"radar.png\"/>\n  </div>\n</section>\n<section id=\"repos\" class=\"bg-danger\">\n  <div class=\"container\">\n  <div class=\"stars\" style=\"background:#000 url('stars2.png') repeat top center;\"></div>\n  <div class=\"twinkling\" style=\"background:transparent url('twinkling.png') repeat top center;\"></div>\n    <div class=\"row\">\n        <div class=\"col-md-6 \">\n            <i class=\"fa fa-rocket fa-4x  \" data-wow-duration=\"1s\"></i><h2 class=\"section-heading\">Random Facts</h2>\n        </div>\n        <div class=\"col-md-6 text-xs-left  \" data-wow-duration=\"1s\">\n            <li>I worship Quantum Mechanics</li>\n            <li>I really like Slack</li>\n            <li>I play sports, Skyrim and piano</li>\n        </div>\n    </div>\n  </div>\n</section>\n"}

